import React from "react";
import './phones.css'

const Mobiles = ({ mobiles }) =>{
    return (
        <div>
          <h1>List of available mobiles</h1>
          {mobiles.map((mobile) => (

            <div class="mobile">
                <h1>{mobile.name}</h1>
            </div>
          ))}
        </div>
    )
}

export default Mobiles;
